package com.jingdong.test;

import java.io.BufferedOutputStream;
import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

import com.utils.random.RandomNumberGenerator;

public class UtilsMethodTest {
	
	public static void main(String[] args) {
		//RandomNumberGeneratorTest();
		Base64DecoderTest();
	}
	
	public static void RandomNumberGeneratorTest() {
		String randomNum = RandomNumberGenerator.generateRandomStringBeginWithZero(17);
		System.out.println("randomNum = "+randomNum);
	}
	
	public static void Base64DecoderTest() {
		String bgBase64String = "";
		
		byte[] bgByte = Base64.getDecoder().decode(bgBase64String.getBytes());
		
	    BufferedOutputStream bos = null;
	    try {
			bos = new BufferedOutputStream(new FileOutputStream("F:\\testFolder\\fileOut\\bg.png"));
			bos.write(bgByte);
			bos.flush();
		} catch (FileNotFoundException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}finally {
			
			if(null!=bos) {
				try {
					bos.close();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		}
	    
	}

}
